import React, { useEffect } from 'react';

export const Blink = (props) => {

    useEffect(()=>{
        setInterval(()=>{
            props.hide = !props.hide;
        },250);
    }, [])

    return(
    <div className={props.hide ? 'hide': ''}>{props.name}</div>
    )
}
